// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./ModifiableSoul.sol";

contract MintableSoul is ModifiableSoul {
    mapping(uint256 => address) private _soulCarrier;
    mapping(address => uint256[]) private _carrierSoul;

    event CarrierChanged(uint256 soulId, address newCarrier);

    function carrierOf(uint256 soulId) public view returns (address) {
        require(_exists(soulId), "Soul doesn't exist");
        return _soulCarrier[soulId];
    }

    function getSoul(address carrier)
        public
        view
        returns (uint256[] memory soulIds)
    {
        soulIds = _carrierSoul[carrier];
        return soulIds;
    }

    function hasSoul(address person) public view returns (bool) {
        return balanceOf(person) > 0;
    }

    // todo: add fee for mint
    function mint(uint256 soulId) public payable {
        require(balanceOf(msg.sender) == 0, "You already mint you soul");

        _safeMint(tx.origin, soulId);
        _soulCarrier[soulId] = tx.origin;
        _carrierSoul[tx.origin].push(soulId);

        // add specific modifications
        // _setModification(soulId, modification);
        // fee for service = 1 gwei
        // random modification
        bytes32 randMods =
            keccak256(
                abi.encodePacked(block.number, blockhash(block.number), soulId)
            );
        _setModification(soulId, randMods);
    }

    function _profitFor(uint256 soulId)
        internal
        view
        returns (address, address)
    {
        address owner = ownerOf(soulId);
        address carrier = carrierOf(soulId);
        return (owner, carrier);
    }

    function _changeCarrier(uint256 soulId, address newCarrier) internal {
        require(
            _soulCarrier[soulId] == tx.origin,
            "You are not carrier of this soul"
        );
        _soulCarrier[soulId] = newCarrier;
        _carrierSoul[newCarrier].push(soulId);
        emit CarrierChanged(soulId, newCarrier);
    }

    //for test
    function changeCarrier(uint256 soulId, address newCarrier) public {
        _soulCarrier[soulId] = newCarrier;
        _carrierSoul[newCarrier].push(soulId);
        emit CarrierChanged(soulId, newCarrier);
    }
}
